import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { createRoot } from 'react-dom/client';
import Basic from './layout/basic';
import App from './layout/app';
import Single from './layout/single';
import Singlee from './layout/Singlee';
import PreguntFrec from './layout/preguntfrec';
import Carrusel from './Carrusel'; // Asegúrate de importar Carrusel desde la ubicación correcta
import Carrusell from '/workspaces/project/src//Carrusell'; 

const feather = require('feather-icons');
setTimeout(() => {
  feather.replace();
}, 1000);

const router = createBrowserRouter([
  {
    path: '/',
    element: <Basic />,
    children: [
      {
        path: '',
        element: <App />,
      },
      {
        path: '/detalle/:slug',
        element: <Single />,
      },
      {
        path: '/detalle_grafica/:slug', // Asegúrate de utilizar la ruta correcta para las tarjetas gráficas
        element: <Singlee />,
      },
      {
        path: '/preguntas',
        element: <PreguntFrec />,
      },
      {
        path: '/procesadores', // Añade la ruta para los procesadores
        element: <Carrusel />,
      },
      {
        path: '/tarjetas_graficas', // Añade la ruta para las tarjetas gráficas
        element: <Carrusell />,
      },
    ],
  },
]);

const root = createRoot(document.getElementById('root'));

function renderApp() {
  root.render(
    <Router>
      <Routes>
        <Route element={<RouterProvider router={router} />} />
      </Routes>
    </Router>
  );
}

renderApp();

export default renderApp;
